__NUXT_JSONP__("/gallery/spooky-road", (function(a,b,c,d){return {data:[{document:{date:a,title:[{type:"heading3",text:"Gators and Lizards and Snakes... Oh My!",spans:[]}],photo:{dimensions:{width:800,height:1200},alt:a,copyright:a,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002Fe67e0979-99c7-4e2e-ba73-913fe45b389b_Spooky+Road.jpg?auto=compress,format",small:{dimensions:{width:320,height:480},alt:a,copyright:a,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002Fe67e0979-99c7-4e2e-ba73-913fe45b389b_Spooky+Road.jpg?auto=compress,format&rect=0,0,800,1200&w=320&h=480"}},content:[{type:b,text:"Florida is a state where historic treasure lies in the most unlikely places…\nNestled  between the pristine lawns of Palm Coast`s elegant developments and the  endless sands of Flagler Beach is the ruins of the ancient Bulow sugar  plantation.",spans:[]},{type:b,text:"Accessing this beautiful state park from the beach,  the change of scenery is amazing… overhanging trees covered with spanish  moss, with the pointed leaves of palmetto shrubs jutting out like  Flamenco dancer’s fans. And on this particular path leading up to the  site of the decaying shell of the once flourishing mill, you never know  what’s gonna jump out from behind one of those spooky trees and slither  towards you faster than you thought it could…",spans:[]},{type:b,text:"When I took this  shot, an afternoon thunderstorm was approaching from behind (like WAY  spooky…don’t think I’d ever felt more alone and vulnerable to the  elements in my life!), and I believe that such atmospheric change can  affect the results you get from infrared photography.",spans:[]},{type:b,text:"Shot on Kodak high speed B\u002FW infrared film with a Mamiya 35mm SLR (with manual film advance!!), 1\u002F60 sec. at f16.",spans:[]},{type:b,text:"Print scanned on an Epson V500 flatbed scanner to digital, no post processing. See my image Alone On Stilts for more info on shooting with Infrared film.",spans:[{start:c,end:d,type:"em"},{start:c,end:d,type:"strong"}]}],tag:"landscape infrared"}}],fetch:[],mutations:void 0}}(null,"paragraph",92,107)));